DROP TABLE IF EXISTS `count_gallery_images_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`casinocaliente`@`%` SQL SECURITY DEFINER VIEW `count_gallery_images_view` AS select `g`.`id_sucursal` AS `id`,count(`g`.`id_sucursal`) AS `cantidad` from (`sucursal_galeria` `g` join `sucursal` `s` on((`s`.`id_sucursal` = `g`.`id_sucursal`))) group by `g`.`id_sucursal`;

DROP TABLE IF EXISTS `count_gallery_line_view`;
CREATE ALGORITHM=UNDEFINED DEFINER=`casinocaliente`@`%` SQL SECURITY DEFINER VIEW `count_gallery_line_view` AS select `g`.`id_linea` AS `id`,count(`g`.`id_linea`) AS `cantidad` from (`linea_galeria` `g` join `linea` `l` on((`l`.`id_linea` = `g`.`id_linea`))) group by `g`.`id_linea`;

