(1,	0,	'Caliente Club',	'caliente-club',	'',	0,	'<p><span style=\"line-height: normal;\"><iframe src=\"http://www.grupocaliente.com.mx/ws/caliente-club/bienvenida-caliente-club.html\" style=\"width:100%; height:1249px;\"> </iframe></span><br></p>',	1,	0,	0,	0,	'',	'2017-02-11 20:02:34',	'2017-02-11 14:02:34'),
(2,	0,	'Ubicaciones',	'ubicaciones',	'/assets/img/paginas/article2.jpg',	0,	'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam a convallis quam, consectetur vulputate erat. Fusce faucibus nisi in quam finibus, eget sodales erat vestibulum. Donec quis massa vitae neque rutrum pulvinar. Aliquam sagittis lacus in nulla aliquet lobortis. Aliquam sed tellus a lacus malesuada lacinia. Curabitur imperdiet orci sed vulputate porttitor. Morbi eu tellus aliquam, commodo nunc non, commodo ex. Aenean sit amet tristique metus. Suspendisse potenti. Interdum et malesuada fames ac ante ipsum primis in faucibus. Vestibulum nisi ex, viverra non consectetur et, ullamcorper non justo. Sed pharetra mattis tristique.',	1,	0,	1,	0,	'',	'2016-12-23 01:02:00',	'0000-00-00 00:00:00'),
(3,	0,	'Quienes somos',	'quienes_somos',	'/assets/img/paginas/article2a.jpg',	0,	'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Etiam a convallis quam, consectetur vulputate erat. Fusce faucibus nisi in quam finibus, eget sodales erat vestibulum. Donec quis massa vitae neque rutrum pulvinar. Aliquam sagittis lacus in nulla aliquet lobortis. Aliquam sed tellus a lacus malesuada lacinia. Curabitur imperdiet orci sed vulputate porttitor. Morbi eu tellus aliquam, commodo nunc non, commodo ex. Aenean sit amet tristique metus. Suspendisse potenti. Interdum et malesuada fames ac ante ipsum primis in faucibus. Vestibulum nisi ex, viverra non consectetur et, ullamcorper non justo. Sed pharetra mattis tristique.',	1,	0,	0,	0,	'',	'2017-01-12 19:46:20',	'2017-01-12 13:46:20'),
(4,	0,	'Juego responsable',	'juego_responsable',	'',	0,	'<p class=\"MsoNormal\"><b><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">Acerca\r\nde Ludopatía<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\">La ludopatía o juego patológico se ha definido\r\ncomo un impulso irreprimible de jugar y/o apostar. La palabra se origina del\r\nlatín: ludus, que significa “yo juego” y la palabra griega pathos, que\r\nsignifica afección, enfermedad o pasión por el juego.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><br>\r\nEl juego patológico también se ha definido como una enfermedad crónica y\r\nprogresiva consistente en la falta de control en los impulsos y un deseo\r\nirreprimible de participar en juegos de apuesta. Es una conducta descontrolada\r\nrelacionada con los juegos de azar y las apuestas (Iturriaga, 2010), se refiere\r\na las actividades en las que se realizan apuestas y como componente prominente\r\nse encuentra el azar, incluye todos los juegos de azar y apuestas como las\r\nmáquinas tragamonedas, bingos, casinos, loterías, cupones, cartas, ruletas,\r\ndados, dominó, peleas de animales (gallos, perros), carreras de caballos, entre\r\notros, y más recientemente, las apuestas por internet.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><br>\r\nDe acuerdo a la cuarta versión revisada del Manual Diagnóstico y Estadístico de\r\nlos Trastornos Mentales (DSM-IV-TR, por sus siglas en inglés; APA, 2002), se\r\nubica en la categoría de trastornos del control de impulsos. Sin embargo, es\r\nimportante mencionar que en los avances de la versión más reciente del mencionado\r\nManual Diagnóstico (DSM-V-R) se integra a la clasificación de adicciones,\r\ndebido a las similitudes tanto en su expresión clínica, etiología, comorbilidad\r\nfísica y tratamiento, con las adicciones a sustancias psicoactivas (Nussbaum,\r\net al., 2011).<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><br>\r\n<i><span style=\"font-size:8.0pt;\r\nmso-ansi-language:ES-MX\">Contenido avalado por el&nbsp;&nbsp;<b><u><a href=\"http://www.cepreaa.psicol.unam.mx/\" target=\"_blank\">Centro de\r\nPrevención&nbsp;y Atención de&nbsp;Adicciones, Facultad de Psicología de la\r\nUNAM</a></u></b><o:p></o:p></span></i></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">Tipos de Jugadores<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b style=\"color: rgb(0, 0, 0);\">&nbsp;</b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\">Las siguientes definiciones tienen como\r\nobjetivo brindarle información respecto de los diferentes tipos de jugadores,\r\npara que en caso de que Usted o alguien que conozca consideren que necesitan\r\napoyo para atender el problema de la adicción al juego, puedan tener un marco\r\nde referencia.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b>· El Jugador Social.</b>&nbsp;Decide participar en juegos de azar y\r\napostar con el único fin de pasar un rato ameno, la cantidad de dinero que\r\napuesta se da en función de sus capacidades económicas y sabe que en caso de\r\nperderlo, no tendrá efectos en su economía. Por lo general apuesta con gente\r\nque él conoce y el tiempo que le dedica al juego no interfiere con otras\r\nactividades. Es capaz de dejar de jugar cuando se lo propone sin que esto le\r\ncause sentimientos de culpa o pesar. Dedicarle tiempo a jugar y a apostar no le\r\ngenera problemas en su entorno cotidiano.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b>· El Jugador Profesional.</b>&nbsp;Decide participar en juegos de azar y\r\napostar con el único fin de ganar dinero. No se deja llevar por sus emociones y\r\napuesta en juegos donde después de un estudio previo determina que es muy\r\nfactible ganar.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b>· El Jugador Problema.</b>&nbsp;Participa en juegos de azar y apuesta\r\ncantidades que originalmente estaban destinados para otro fin, apuesta\r\nimportantes cantidades que afectan su economía y la de su familia. Su control\r\nsobre el momento en que debe dejar de jugar es mínimo. Está expuesto a\r\nconvertirse en Jugador Patológico<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b>· El Jugador Patológico.</b>&nbsp;No tiene control sobre el impulso y\r\nnecesidad de jugar a juegos de azar aún y cuando la persona es consciente de\r\nsus consecuencias. Es incapaz de abstenerse y detenerse respecto al juego,\r\nexperimenta una sensación creciente de excitación y tensión antes de ir a jugar\r\ny la experiencia placentera o de alivio en el momento de jugar. Todos estos\r\ncomportamientos generan en el ludópata gradualmente una alteración en las\r\ndiferentes áreas de su vida como la educativa, laboral, económica, familiar y\r\nsocial. Llega a mentir o cometer delitos como el robo, el fraude o la\r\nfalsificación con el fin de obtener dinero para seguir apostando.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">Factores\r\nde Riesgo<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p></p>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"square\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">La poca información que se tiene al respecto.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">La aceptación social del juego ocasional, que lleva al juego\r\n     habitual.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">La facilidad para adentrarse en los juegos a través sorteos\r\n     aparentemente inofensivos como los boletos de rascar y ganar.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Adicciones al alcohol o a las drogas.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Baja tolerancia a la frustración.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Necesidad de aceptación social.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Antecedentes de ansiedad, depresión, impulsividad.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">En los hombres la adicción suele comenzar en la adolescencia,\r\n     mientras que en las mujeres suele presentarse entre los 20 y los 40 años.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Las situaciones estresantes pueden empeorar los problemas del\r\n     juego.[1]<o:p></o:p></span></li>\r\n</ul>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:8.0pt;mso-ansi-language:ES-MX\">[1] Fuente: </span><span lang=\"ES-TRAD\"><a href=\"http://www.cnc.gob.ve/ludopatia.php\"><span lang=\"ES-MX\" style=\"font-size:8.0pt;mso-ansi-language:ES-MX\">http://www.cnc.gob.ve/ludopatia.php</span></a></span><span style=\"font-size:8.0pt;mso-ansi-language:ES-MX\"> <o:p></o:p></span></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">Factores\r\nde Protección<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"square\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l1 level1 lfo2;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">La comunicación e integración familiar basada en valores y principios\r\n     morales.<o:p></o:p></span></li>\r\n</ul>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"square\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo3;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Información acerca del tema.<o:p></o:p></span></li>\r\n</ul>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"square\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l0 level1 lfo4;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">La ayuda por parte de profesionales, familiares, asociaciones y\r\n     grupos de autoayuda.<o:p></o:p></span></li>\r\n</ul>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"square\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l2 level1 lfo5;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Deseo del ludópata de abandonar el juego.<o:p></o:p></span></li>\r\n</ul>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><b><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">Centros\r\nde apoyo a la Ludopatía<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\">Usted podrá dirigirse en caso de\r\nrequerir&nbsp;orientacíón para atender el problema de Juego Patológico a las\r\nsiguientes dependencias gubernamentales:<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p></p>\r\n\r\n<ul style=\"margin-top:0cm\" type=\"square\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Comisión Nacional contra las adicciones | <span lang=\"ES-TRAD\"><a href=\"http://www.conadic.salud.gob.mx/\"><span lang=\"ES-MX\">http://www.conadic.salud.gob.mx/</span></a></span>.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo1;tab-stops:list 36.0pt\"><span style=\"color: rgb(0, 0, 0);\">Centro Nacional para la Prevención y el Control de las Adicciones.\r\n     | <span lang=\"ES-TRAD\"><a href=\"http://www.cenadic.salud.gob.mx/\"><span lang=\"ES-MX\">http://www.cenadic.salud.gob.mx/</span></a></span>.<o:p></o:p></span></li>\r\n</ul>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">&nbsp;</span></p>',	1,	0,	0,	0,	'',	'2017-01-18 01:49:30',	'2017-01-17 19:49:30'),
(5,	0,	'Aviso de privacidad',	'aviso_de_privacidad',	'',	0,	'<p class=\"MsoNormal\"><b><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">Sección| Aviso de Privacidad<o:p></o:p></span></b></p><p class=\"MsoNormal\"><b><span lang=\"ES-TRAD\" style=\"color: rgb(0, 0, 0);\">&nbsp;</span></b></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">AVISO&nbsp;DEPRIVACIDAD DE CALIENTE® Y SUS EMPRESAS AFILIADAS Y SUBSIDIARIAS.<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Deconformidad Estimado usuario, se le notifica que el Aviso de Privacidad ha sidomodificado el día 23 de julio de 2014.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><br>De acuerdo con lo dispuesto en la Ley Federal de Protección de Datos Personalesen Posesión de Particulares (LFPDPPP) publicada el 05 de julio de 2010 y suReglamento.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Hipodrómode Agua Caliente, SA de CV</span></b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">&nbsp;(en adelante&nbsp;<b>CALIENTE®</b><sup>1</sup>)y sus empresas afiliadas y subsidiarias comprometidas a proteger y respetar suprivacidad observando los principios de licitud, consentimiento, información,calidad, finalidad, lealtad, proporcionalidad y responsabilidad en eltratamiento de datos personales, con domicilio en Blvd. Agua Caliente 12027Col. Hipódromo. CP 22420 Tijuana, B.C. México. Nuestro teléfono: (664) 633 7300, señalan como responsable de la obtención, divulgación, almacenamiento, uso,incluido acción de acceso, manejo, aprovechamiento, transferencia o disposiciónde datos personales (en adelante Tratamiento) al&nbsp;<b>Departamento deSeguridad y Riesgo Informático,</b>&nbsp;con domicilio en Blvd. Agua Caliente12027 Col. Hipódromo. CP 22420 Tijuana, B.C. México. Teléfono: (664) 647 4770.Correo electrónico&nbsp;</span><span lang=\"ES-TRAD\"><a href=\"mailto:protecciondedatos@caliente.com.mx2\"><b><span lang=\"ES-MX\" style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">protecciondedatos@caliente.com.mx</span></b><sup><span lang=\"ES-MX\" style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:=\"\" es-mx\"=\"\">2</span></sup></a></span><sup><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p></o:p></span></sup></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">¿Paraqué recabamos y utilizamos tus datos personales?</span></b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Losdatos que le solicitamos serán utilizados para las siguientes finalidades: Parala&nbsp;<b>apertura de una cuenta para: apuesta en Internet o Telefónica, móvily otras modalidades;</b>&nbsp;como son:&nbsp;<b>inscripción a nuestro programade lealtad, promociones y pagos de premios superiores a 2,250 salarios mínimosvigentes generales y pago de premios por excepción.&nbsp;</b>Hacemos de tuconocimiento que la información personal que usted proporciona puedeidentificarlo individualmente y será utilizada para proveer los servicios yproductos requeridos, así como actividades afines. En general, compartimos suinformación únicamente con nuestras empresas filiales o subsidiarias.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Másinformación</span></b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";=\"\" mso-ansi-language:es-mx\"=\"\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Paramayor información usted puede acceder al aviso de privacidad completo a travésde nuestra página www.calientecasino.com.mx, o bien en los&nbsp;<b>módulosanfitriones y cajas&nbsp;de cualquiera de nuestros establecimientos (salas yBooks) en la cual podemos informarle sobre los servicios que ofrecemos y lainformación que le solicitaremos, y evaluar la calidad del servicio que lebrindamos. El titular de los datos personales, podrá ejercer sus derechos deacceso, rectificación, cancelación y oposición (ARCO), en los establecimientosde&nbsp;CALIENTE®,&nbsp;por correo a&nbsp;</b></span><span lang=\"ES-TRAD\"><a href=\"mailto:protecciondedatos@caliente.com.mx\"><b><span lang=\"ES-MX\" style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">protecciondedatos@caliente.com.mx</span></b></a></span><b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">&nbsp;aldomicilio de la oficina&nbsp;Departamento de Seguridad y RiesgoInformático,&nbsp;ubicado en Blvd. Agua Caliente 12027 Col. Hipódromo. CP 22420Tijuana, B.C. México. Teléfono: (664) 647 4770, mediante solicitud por escritoen el formato establecido por&nbsp;CALIENTE®&nbsp;(el cual podrá obtenerse encualquier sucursal, o en la página www.calientecasino.com.mx o vía correoelectrónico) y que contenga la siguiente información:</span></b></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><br></span></b></span></p><ul><li style=\"text-align: justify; margin-left: 25px;\"><b style=\"background-color: transparent; font-size: 14px; letter-spacing: 0.01em;\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">El nombre     completo del titular de los datos personales, domicilio y cuenta de correo     electrónico, para poder comunicarle la respuesta a su solicitud.</span></b></li><li style=\"text-align: justify; margin-left: 25px;\"><b style=\"background-color: transparent; font-size: 14px; letter-spacing: 0.01em;\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Los     documentos que acrediten la identidad y en su caso la representación legal     del titular de los datos personales.</span></b></li><li style=\"text-align: justify; margin-left: 25px;\"><b style=\"background-color: transparent; font-size: 14px; letter-spacing: 0.01em;\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">La     descripción clara y precisa de los datos personales respecto de los que se     busca ejercer alguno de los derechos antes mencionados.</span></b></li><li style=\"text-align: justify; margin-left: 25px;\"><b style=\"background-color: transparent; font-size: 14px; letter-spacing: 0.01em;\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Cualquier     otro elemento o documento que facilite la localización de los datos     personales.</span></b></li><li style=\"text-align: justify; margin-left: 25px;\"><b style=\"background-color: transparent; font-size: 14px; letter-spacing: 0.01em;\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">En el caso de     solicitudes de rectificación de datos personales, el titular, deberá     requisitar el \"Formato de actualización de datos\" en cualquier     establecimiento de&nbsp;CALIENTE®,&nbsp;indicar, las modificaciones a     realizarse y aportar la documentación que sustente su petición.</span></b></li><li style=\"text-align: justify; margin-left: 25px;\"><b style=\"background-color: transparent; font-size: 14px; letter-spacing: 0.01em;\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">En caso del     ejercicio del derecho de negación el titular deberá acudir directamente a     la oficina del&nbsp;Departamento de Seguridad y Riesgo Informático.&nbsp;<sup>3</sup></span></b></li></ul><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Transferenciade Datos Personales.</span></b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";=\"\" mso-ansi-language:es-mx\"=\"\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Teinformamos que&nbsp;<b>CALIENTE®&nbsp;podrá realizar la transferencia de datosa:<o:p></o:p></b></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></b></p><ul style=\"margin-top:0cm\" type=\"square\"> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l0 level1 lfo2;tab-stops:list 36.0pt\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Las empresas     afiliadas y subsidiarias de&nbsp;CALIENTE®&nbsp;a nivel nacional e     internacional.<o:p></o:p></span></b></li> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l0 level1 lfo2;tab-stops:list 36.0pt\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Terceros     proveedores de servicios para el cumplimiento de las obligaciones legales     adquiridas&nbsp;CALIENTE®&nbsp;o por cualquiera de las empresas afiliadas     y subsidiarias.<sup>4</sup><o:p></o:p></span></b></li> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l0 level1 lfo2;tab-stops:list 36.0pt\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Terceros     derivado de un reestructura corporativa, incluyendo, la fusión,     consolidación, venta, liquidación o transferencia de activos     de&nbsp;CALIENTE®.<o:p></o:p></span></b></li> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l0 level1 lfo2;tab-stops:list 36.0pt\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Otras     transmisiones previstas en la Ley citada y su Reglamento.<o:p></o:p></span></b></li></ul><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><br>En caso que&nbsp;CALIENTE®&nbsp;llegara a transferir tus Datos Personales aalguno otro de sus proveedores con el fin de llevar a cabo las Finalidades delTratamiento establecidas en el presente Aviso de Privacidad, lo hará previacelebración de convenios de confidencialidad y, siempre y cuando (i) elproveedor o persona a quien se le transmitan acepte someter el tratamiento delos Datos Personales al presente Aviso de Privacidad, y (ii) no se trate dealguno de los supuestos establecidos en el artículo 37 de la LFPDPPP. Si ustedno manifiesta su oposición para que sus Datos Personales sean transferidos aterceros, se entenderá que ha otorgado a&nbsp;CALIENTE®&nbsp;su consentimientopara ello. El titular de datos personales que pretende entablar una relaciónjurídica con&nbsp;CALIENTE®&nbsp;o por cualquiera de las filiales, acepta latransferencia de sus datos personales, en los términos descritos en el presenteAviso de Privacidad.<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Cambiosen el Aviso de Privacidad</span></b><span style=\"font-size:10.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Cualquiercambio al presente aviso de privacidad, le será informado a través decualquiera de los siguientes medios:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p>&nbsp;</o:p></span></p><ol style=\"margin-top:0cm\" start=\"1\" type=\"1\"> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l1 level1 lfo3;tab-stops:list 36.0pt\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Avisos en los     establecimientos de&nbsp;<b>CALIENTE®.</b><o:p></o:p></span></li> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l1 level1 lfo3;tab-stops:list 36.0pt\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Correo     electrónico proporcionado por el titular de datos personales.<o:p></o:p></span></li> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l1 level1 lfo3;tab-stops:list 36.0pt\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Avisos en el     portal de Internet de&nbsp;<b>CALIENTE®&nbsp;</b>(www.calientecasino.com.mx).<o:p></o:p></span></li> <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;     mso-list:l1 level1 lfo3;tab-stops:list 36.0pt\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Cualquier otro     medio de comunicación público o privado previstos en los contratos que     amparan las operaciones celebradas entre&nbsp;<b>CALIENTE®</b>&nbsp;o por     cualquiera de las empresas afiliadas.<o:p></o:p></span></li></ol><div class=\"MsoNormal\"><span style=\"font-size: 10pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";=\"\" mso-ansi-language:es-mx\"=\"\"><hr size=\"3\" width=\"267\" style=\"width:200.0pt\" align=\"left\"></span></div><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"color: rgb(0, 0, 0);\"><i><sup><span style=\"font-size:7.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">1</span></sup></i><b><i><span style=\"font-size:7.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">CALIENTE®&nbsp;es una unidadeconómica conformada por empresas permisionarias de juegos y sorteosdebidamente reguladas por la Secretaría de Gobernación, de acuerdo con lo quese establece en la Ley Federal de Juegos y Sorteos del 31 de diciembre de1947.&nbsp;Hipódromo de Agua Caliente, S.A. de C.V., Grupo Océano Haman, SA deCV., Operadora de Apuestas Caliente, SA de CV., Impulsora Géminis, SA de CV.,Espectáculos Latinoamericanos Deportivos, SA de CV. Espectáculos DeportivosCancún, SA de CV, Tecnología en Entretenimiento Caliplay, S. de R.L. de C.V.</span></i></b><i><span style=\"font-size:7.0pt;font-family:\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\"><o:p></o:p></span></i></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><i><span style=\"font-size: 7pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">&nbsp;<br><sup>2</sup>Esta dirección de correo electrónico está siendo protegida contrarobos de spam. Necesita tener JavaScript habilitado para poder verlo<o:p></o:p></span></i></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><i><span style=\"font-size: 7pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">&nbsp;<br><sup>3</sup>Para las finalidades que dieron origen y que son necesarias para larelación jurídica, se entenderá que, en caso de solicitar el derecho denegación, el Titular acepta que no podrá contratar los productos o serviciosque proporciona CALIENTE®&nbsp;y/o las empresas afiliadas y subsidiarias.<o:p></o:p></span></i></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><i><span style=\"font-size: 7pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">&nbsp;<br><sup>4</sup>CALIENTE®&nbsp;mantiene un contrato con proveedores BMM BISMARKETING MEXICO S.A. DE C.V., y TECNOLOGIA Y SOLUCIONES APLICADAS S.A. DE C.V.quienes prestan servicios de envíos masivos de mensajes mediante comunicacionespor correo electrónico, en el entendimiento de que CALIENTE® se encuentraobligado a respetar las políticas anti-spam establecidas por cada una de lasempresas., dentro de las cuales destacan las prohibiciones de enviar correoselectrónicos a personas que no lo soliciten o autoricen, así como la deutilizar bases de datos para el envío de las referidas comunicaciones, salvolas generadas por el propio CALIENTE®.</span></i></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size: 8pt; color: rgb(0, 0, 0);\" helvetica=\"\" neue\";mso-ansi-language:es-mx\"=\"\">Fecha de creación: 8 de Julio de 2011<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text