(22,	NULL,	'Términos y condiciones',	'terminos-y-condiciones-caliente-club',	'',	0,	'<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b style=\"color: rgb(0, 0, 0);\">Programa de Lealtad Caliente Club<o:p></o:p></b></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b style=\"color: rgb(0, 0, 0);\">&nbsp;</b><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Cualquiera de las\r\nsiguientes: Hipódromo de Agua Caliente S.A. de CV., Impulsora Géminis, S.A. de CV., Grupo 0céano Haman, S.A.\r\nde CV., Espectáculos Latinoamericanos&nbsp;\r\nDeportivos, S.A. de CV., (en lo sucesivo \"La permisionaria\")\r\nestablece los términos y Condiciones con los que opera el Programa de Lealtad\r\nCaliente Club (Definidas en lo subsecuente y en conjunto como el\r\nPrograma).&nbsp; La afiliación a el Programa\r\nsignifica que la persona acepta los Términos y Condiciones contenidos en el\r\npresente documento. Dichos Términos y Condiciones pueden ser modificados por\r\n“La permisionaria” unilateralmente y sin previo aviso, por lo que el cliente se\r\nencontrará obligado a consultarlos&nbsp; vía\r\nelectrónica y periódicamente en las versiones más recientes de este documento\r\nen el portal de Internet de la permisionaria o directamente en los\r\nestablecimientos Caliente participantes.</span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b style=\"color: rgb(0, 0, 0);\">&nbsp;</b><b style=\"color: rgb(0, 0, 0); background-color: transparent;\">1. Programa de Lealtad Caliente Club:</b></p><ol style=\"margin-top:0cm\" start=\"1\" type=\"a\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">El Programa es un beneficio creado, desarrollado y administrado por\r\n     la permisionaria, la cual, otorga a sus clientes el derecho de obtener y\r\n     acumular puntos por su actividad de juego, encontrándose&nbsp; condicionado al cumplimiento de todos y\r\n     cada uno de los términos&nbsp; y\r\n     condiciones de este programa.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">Se podrán inscribir todos aquellos clientes que deseen obtener los\r\n     beneficios que se otorgan.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">Los clientes inscritos en el Programa obtendrán una tarjeta única\r\n     con un número de cuenta&nbsp; propia de 6\r\n     (seis) dígitos y con la cual se irán&nbsp;\r\n     acumulando los puntos, los cuales podrán ser utilizados&nbsp; para la obtención de beneficios\r\n     otorgados por la permisionaria.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria no tendrá responsabilidad alguna de que el\r\n     cliente&nbsp; registre su información\r\n     incompleta o&nbsp; incorrecta, por lo que\r\n     desde este momento el cliente será el único responsable de ello, liberando\r\n     a la permisionaria de cualquier contingencia que pudiere suscitarse por\r\n     dicha situación.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">Los beneficios ofrecidos a través del programa están sujetos a\r\n     cambios previo aviso que será publicado en el módulo de anfitriones del\r\n     establecimiento Caliente participante, con al menos 14 días de anticipación.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">Los beneficios son exclusivamente para el propietario de la tarjeta\r\n     presentando la acreditación acorde a lo estipulado por la permisionaria,\r\n     por lo cual, los mismos son personales e intransferibles<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">Para que el cliente pueda hacer válido cualquier beneficio es\r\n     indispensable presentar su tarjeta Caliente Club del nivel\r\n     correspondiente, así como una identificación oficial.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l4 level1 lfo3\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria se reserva el derecho para resolver cualquier\r\n     incidente que pudiera presentarse en relación con todos y cada uno de los\r\n     términos y condiciones para el uso del programa.<o:p></o:p></span></li>\r\n</ol><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b style=\"color: rgb(0, 0, 0);\">&nbsp;</b><b style=\"color: rgb(0, 0, 0); background-color: transparent;\">2. Acumulación de puntos:</b></p><ol style=\"margin-top:0cm\" start=\"1\" type=\"a\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Se acumulan puntos por la actividad de juego generada en máquinas de\r\n     juego de los establecimientos Caliente participantes, de acuerdo a lo\r\n     estipulado por la permisionaria.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Para que los puntos sean acumulados en la cuenta del cliente es\r\n     necesario que el propietario presente en todo momento su tarjeta y no\r\n     deberá manejar más de una cuenta. El cliente no acumula puntos por su\r\n     participación en fechas anteriores a su afiliación a el Programa <o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Los puntos acumulados&nbsp; en la\r\n     tarjeta del cliente se acreditan en tiempo real inmediatamente\r\n     después&nbsp; de haber participado,\r\n     siempre y cuando se cumpla con todos los términos y&nbsp; condiciones aquí establecidas. Los\r\n     puntos acumulados en cualquier otra tarjeta no son propiedad del cliente,\r\n     y no podrán ser transferidos a persona o entidad alguna, ni tampoco&nbsp; podrán ser transferidos a otra&nbsp; cuenta, inclusive de el Programa. <o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Los puntos acumulados en cada&nbsp;\r\n     tarjeta del Programa no son susceptibles&nbsp; de combinarse con los de otra tarjeta\r\n     del Programa para cambiarlos por beneficios, ni para ningún otro fin, por\r\n     lo que no podrán ser cedidos o transferidos de una&nbsp; tarjeta a otra, así&nbsp; como tampoco serán acumulables en otra\r\n     cuenta.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Los puntos acumulados no son susceptibles de comercializarse, son\r\n     intransferibles, inembargables y únicamente podrán ser utilizados por el\r\n     titular de la tarjeta del Programa.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Los puntos acumulados no tendrán valor monetario, por lo que no\r\n     podrán, en ningún caso, redimirse por dinero en efectivo.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Los puntos acumulados no tendrán validez para ser cambiados por\r\n     bebidas que contengan alcohol en ningún caso.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Los puntos&nbsp; utilizados\r\n     para&nbsp; recepción de un&nbsp; beneficio, no podrán ser convertidos ni\r\n     acreditados nuevamente a&nbsp; la tarjeta\r\n     o cuenta del cliente ni a ninguna otra cuenta o tarjeta.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria se reserva el derecho de modificar la lista de\r\n     productos participantes; sus respectivos beneficios y vigencias en\r\n     cualquier momento sin notificación previa a los clientes o a su clientela.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l3 level1 lfo6\"><span style=\"color: rgb(0, 0, 0);\">Los puntos generados expirarán a los 365 días posteriores a su\r\n     obtención.<o:p></o:p></span></li>\r\n</ol><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b style=\"color: rgb(0, 0, 0);\">&nbsp;</b><b style=\"color: rgb(0, 0, 0); background-color: transparent;\">3. Tarjeta del Programa de Lealtad Caliente\r\nClub:</b></p><ol style=\"margin-top:0cm\" start=\"1\" type=\"a\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l2 level1 lfo4\"><span style=\"color: rgb(0, 0, 0);\">La tarjeta del Programa es el identificador de los clientes y es\r\n     donde se contabilizan los puntos y&nbsp;\r\n     el saldo de su cuenta en la permisionaria.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l2 level1 lfo4\"><span style=\"color: rgb(0, 0, 0);\">Los clientes&nbsp; solo pueden\r\n     tener una tarjeta para acumulación&nbsp;\r\n     de puntos, participación en&nbsp;\r\n     promociones establecidas.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l2 level1 lfo4\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria no se hace responsable en caso de robo o pérdida de\r\n     la tarjeta del programa.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l2 level1 lfo4\"><span style=\"color: rgb(0, 0, 0);\">En caso de extravío, el cliente podrá solicitar ante el módulo de\r\n     anfitriones del establecimiento Caliente participante, el reemplazo de su\r\n     tarjeta Caliente Club, para ello deberá presentar una de las\r\n     identificaciones aceptadas por el establecimiento y las cuales se\r\n     encuentran publicadas en el módulo de anfitriones, previo el pago de\r\n     $50.00 Pesos (CINCUENTA, PESOS M.N.)<o:p></o:p></span></li>\r\n</ol><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p><b style=\"color: rgb(0, 0, 0); background-color: transparent;\">4. Redención de Puntos:</b></p><ol style=\"margin-top:0cm\" start=\"1\" type=\"a\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">El cliente podrá solicitar la primer redención de puntos después de\r\n     acumular sus primeros 3,000 puntos por actividad en máquinas de juego a\r\n     partir de su afiliación al Programa, antes de esto no será posible redimir\r\n     los puntos acumulados por ninguno de los beneficios establecidos por la\r\n     permisionaria.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">Para hacer uso de los puntos acreditados, es necesario que el\r\n     cliente&nbsp; haya completado y firmado\r\n     de conformidad el registro de inscripción y los Términos y&nbsp; Condiciones del Programa.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">Para el canje de\r\n     puntos; por beneficios, el cliente deberá presentar su tarjeta&nbsp; del Programa junto con una\r\n     identificación oficial, en los establecimientos Caliente participantes y\r\n     firmar su consentimiento en el comprobante de redención.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">Para obtener algún beneficio deseado es necesario contar con la\r\n     totalidad de los puntos establecidos en cada caso.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria se reserva el derecho de modificar la cantidad de puntos\r\n     necesarios para obtener cualquier beneficio, pudiendo dar&nbsp; aviso&nbsp;\r\n     con 14 días de\r\n     anticipación a los clientes.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">Cualquier uso indebido con respecto a la generación de puntos, puede\r\n     resultar en la cancelación de la tarjeta y de la afiliación al Programa.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria puede ofrecer Obsequios que se darán&nbsp; a conocer por medio de un catálogo o por\r\n     los medios que la permisionaria crea más convenientes, considerando que\r\n     dichos Obsequios pueden entregarse por un período determinado o hasta\r\n     agotar existencias, según sea el caso.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">La entrega de los artículos se realizará en los establecimientos\r\n     Caliente participantes; en la fecha&nbsp;\r\n     que se indique&nbsp; al cliente,\r\n     al momento de utilizar sus puntos.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">Al momento de la entrega, el cliente deberá revisar el buen estado del\r\n     obsequio en presencia del personal del establecimiento Caliente\r\n     participante y firmar de recibido únicamente si se encuentra plenamente\r\n     satisfecho con el perfecto estado del obsequio.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria (nombre) no es responsable de la garantía de los Obsequios\r\n     que se intercambian por puntos, por&nbsp;\r\n     la que ante el evento de cualquier defecto o&nbsp; mal funcionamiento de los&nbsp; mismos el cliente deberá dirigirse\r\n     directamente con los proveedores de los artículos.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">Los artículos están sujetos a existencia, por lo que de no haber\r\n     disponibilidad se procederá a la cancelación de la redención y devolución\r\n     de puntos al cliente.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l5 level1 lfo1\"><span style=\"color: rgb(0, 0, 0);\">El tiempo de entrega de los artículos en existencia es de 5 (CINCO)\r\n     días naturales a partir de la solicitud.<o:p></o:p></span></li>\r\n</ol><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p><b style=\"color: rgb(0, 0, 0); background-color: transparent;\">5. Estados de Cuenta de la Tarjeta Caliente\r\nClub:</b></p><ol style=\"margin-top:0cm\" start=\"1\" type=\"a\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l1 level1 lfo2\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria podrá informar a los clientes el estado de\r\n     cuenta&nbsp; de sus puntos acumulados.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l1 level1 lfo2\"><span style=\"color: rgb(0, 0, 0);\">Los clientes&nbsp; pueden&nbsp; en solicitar su estado de cuenta en&nbsp; el módulo de anfitriones de los\r\n     establecimientos Caliente participantes y al teléfono del Programa de\r\n     Lealtad Caliente Club 01 800 831 13 10 nacional. También podrán solicitar\r\n     su estado de cuenta al correo electrónico\r\n     programa.lealtad@caliente.com.mx&nbsp; o\r\n     con el responsable en los establecimientos participantes y presentando la\r\n     acreditación acorde a estipulado por la permisionaria.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l1 level1 lfo2\"><span style=\"color: rgb(0, 0, 0);\">Los estados de cuenta&nbsp; podrán\r\n     ser entregados al cliente en el establecimiento Caliente participante, o\r\n     enviados a su cuenta&nbsp; de correo\r\n     electrónico en forma semanal, quincenal, o mensual si así lo solicita.<o:p></o:p></span></li>\r\n</ol><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><o:p style=\"color: rgb(0, 0, 0);\">&nbsp;</o:p><b style=\"color: rgb(0, 0, 0); background-color: transparent;\">6. Niveles del Programa de Lealtad Caliente\r\nClub:</b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><ol style=\"margin-top:0cm\" start=\"1\" type=\"a\">\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l0 level1 lfo5\"><span style=\"color: rgb(0, 0, 0);\">Cada cliente afiliado formará parte de un Nivel Caliente Club de\r\n     acuerdo a su actividad en puntos por el cual recibirá los beneficios que\r\n     estipule la permisionaria y estarán publicados en los establecimientos\r\n     Caliente participantes. <o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l0 level1 lfo5\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria valorará cada 90 días, el uso y los puntos\r\n     generados por el cliente, a efecto de que este último permanezca, ascienda\r\n     a un nuevo nivel o bien descienda del nivel que actualmente tiene dentro\r\n     del programa.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l0 level1 lfo5\"><span style=\"color: rgb(0, 0, 0);\">Toda aquella tarjeta qua no sea utilizada en un&nbsp; periodo de 12 meses, se cancelará\r\n     automáticamente junto con los puntos que se hayan acumulado, por lo que el titular sólo podrá\r\n     recuperar los puntos de su saldo disponible mediante la solicitud que\r\n     realice directamente en los establecimientos Caliente participantes y\r\n     presentando&nbsp; la acreditación acorde\r\n     a lo estipulado por la permisionaria.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l0 level1 lfo5\"><span style=\"color: rgb(0, 0, 0);\">Solo aplican los beneficios de su tarjeta Caliente Club de acuerdo\r\n     al nivel que el cliente posee, al presentar la tarjeta Caliente Club la\r\n     misma no deberá presentar tachaduras, enmendaduras, raspaduras,\r\n     manipulación o alteración alguna que con lleve a dudar de su legitimidad,\r\n     si este es el caso el cliente tendrá que solicitar&nbsp; la reposición de la misma.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l0 level1 lfo5\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria se reserva el derecho para resolver cualquier\r\n     incidente que pudiera presentarse en relación al uso que el propietario dé\r\n     a la tarjeta.<o:p></o:p></span></li>\r\n <li class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\n     mso-list:l0 level1 lfo5\"><span style=\"color: rgb(0, 0, 0);\">La permisionaria no será responsable por el uso que se dé a la\r\n     tarjeta en caso de robo o extravío.</span><o:p></o:p></li>\r\n</ol>',	1,	0,	0,	1,	'',	'2017-03-07 17:03:33',	'2017-03-07 11:03:33'),
