INSERT INTO `juego` (`id_juego`, `id_linea`, `id_categoria`, `nombre`, `slug`, `titulo`, `imagen`, `thumb`, `resumen`, `aprender`, `reglas`, `estatus`, `eliminado`, `created_at`, `updated_at`) VALUES
(1,	1,	2,	'Powermania 2',	'powermania-2',	'Powermania Bonus',	'/assets/images/juegos/8s68hsfyo263chk5d.jpg',	NULL,	'Los clásicos nunca pasan de moda',	'Powermania Bonus es el clásico de los clásicos en los juegos de videobingo, es uno de los juegos con más éxito de Zitro y ha triunfado allá donde ha ido.\r\nDisfruta de nuestro juego más característico que ha marcado una época en el sector de los juegos de bingo.',	'Encuentra a Jerry para lograr aumentar los premios en su juego de bonus,\r\ncada vez que aparezca nuestro divertido personaje aumentarás tu premio.\r\nSuperbingo, Thunderball, Rebajas y Jerrypot… Ten acceso a todo esto con solo pulsar el botón de Super Win.',	1,	1,	'2016-08-30 16:48:42',	'2017-03-03 16:31:06'),
(2,	1,	2,	'Britney Spears de Aristocrat',	'britney-spears-de-aristocrat',	'Britney Spears',	'/assets/images/juegos/waym8w4pxhyoy57mx.jpg',	'/assets/images/juegos/cg2m7g078rqani1qg.jpg',	'Vive la experiencia de las magníficas presentaciones que ha realizado la cantante durante toda su carrera musical.',	'Esta máquina cuenta con dos formas iniciales de juego: el modo “Equalizer” y el Oops I Did It Again Re-spin” asi como 4 divertidos bonus: “Crazy Feature Gateway,” “Oops I Did It Again Free Games,” “Toxic Picks” y la “Hit Me Baby One More Time Wheel.” ',	'Nuestro nuevo juego Britney Spears de Aristocrat cuenta con 60 líneas de juego con 50 créditos de apuesta, con una denominación  de 10 centavos \r\n',	1,	0,	'2016-08-30 16:48:42',	'2017-03-08 15:17:32'),
(3,	1,	2,	'Game of Thrones de Aristocrat',	'game-of-thrones-de-aristocrat',	'Casino Hold ‘Em',	'/assets/images/juegos/v048wgd64o3xqvkp9.jpg',	'/assets/images/juegos/38ini9ga4q858y8mv.jpg',	'Todo el drama, la aventura y la acción de la legendaria epopeya de Game Of Thrones en este nuevo juego.',	'El  juego Game Of Thrones de Aristocrat tiene 3 principales forma de juego principal: Stark, Lannister y Targaryen\r\n\r\n•	Game of Thrones de Aristrocrat tienen divertidas funciones y 4 principales características:\r\n•	La pared donde los conjuntos de bobinas pueden crecer hasta 16 símbolos\r\n•	La Batalla de Blackwater Bay donde se otorgan hasta seis juegos gratuitos en un nuevo juego especial de rodillos\r\n•	La Madre de los Dragones, donde jugarás una función pick\'em con huevos de dragón y Multiplicador 50X\r\n\r\n',	'Game of Thrones de Aristocrat cuenta con 243 formas de ganar con 50 créditos de apuesta, con un denominaciones  de 10 centavos ',	1,	0,	'2016-08-30 16:48:42',	'2017-03-08 15:17:49'),
(4,	1,	2,	'Bobby Doggie de Zitro',	'bobby-doggie-de-zitro',	'Bobby Doggie',	'/assets/images/juegos/9dsw9x5395mbh9je1.jpg',	'/assets/images/juegos/x0qvqx1nvaseneua1.jpg',	'¡El juego de Bobby ya esta aquí!',	'Bobby ha vuelto con más fuerza que nunca, un nuevo juego en el que la mascota canina de ZITRO es el gran protagonista. Bobby se convertirá en tu amigo más fiel y además te hará conseguir fabulosos premios.',	'Juega con este divertido perro al bonus de los rodillos para lograr los premios más deseados. Gana partidas gratis el bonus gracias leal amigo Bobby.\r\nSuperbingo, Thunderball, Rebajas, Jerrypot y Bobby… Accede a todo esto con solo pulsar el botón de Super Win.',	1,	0,	'2016-08-30 16:48:42',	'2017-03-08 15:16:21'),
(5,	2,	NULL,	'Three Card Poker',	'three-card-poker',	'Three Card Poker',	'/assets/images/juegos/jrmxic6ihxrvdpeiv.jpg',	NULL,	'En una versión basada en el  tradicional juego de póker, se juega con un mazo de cartas o tarjetas; el objetivo de los participantes es hacer la mejor combinación de tres cartas o tarjetas;  el objetivo de los  participante es ganarle al facilitador obteniendo  un rango mayor de combinación de cartas o tarjetas, lo que le permite la obtención de un premio  según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.\r\n',	'Aprender Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer rutrum turpis nec diam dapibus porttitor sed sodales quam. Aliquam sit amet accumsan justo. Duis fermentum quis dui id vestibulum.',	'Reglas Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer rutrum turpis nec diam dapibus porttitor sed sodales quam. Aliquam sit amet accumsan justo. Duis fermentum quis dui id vestibulum.',	1,	0,	'2016-08-30 16:48:42',	'2017-02-02 20:43:10'),
(6,	2,	NULL,	'Blackjack',	'blackjack',	'Blackjack',	'/assets/images/juegos/ogpz675rs09xb8lu6.jpg',	NULL,	'El juego tradicional de blackjack se juega con seis  mazos de cartas o tarjetas; El objetivo de los participantes es obtener la combinación de blackjack o el puntaje más cercado de veintiuno pero sin excederse; Los participantes  deberán de realizar sus apuestas antes de que el facilitador cierre las apuestas e inicie con la ronda de repartición;  para ganar el participante deberá  de tomar decisiones con respecto a su mano y sin excederse de veintiuno  obtener un puntaje mayor que el facilitador, lo que le permite la obtención de un premio según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.  \r\n\r\n**Consulte las reglas para las versiones de Blackjack Switch, Blackjack Lucky Lucky.\r\n',	'12345',	'987654',	1,	0,	'2016-08-30 16:48:42',	'2017-02-10 14:13:48'),
(7,	2,	NULL,	'Baccarat',	'baccarat',	'Baccarat',	'/assets/images/juegos/j0v84syhug1rdc8l6.jpg',	NULL,	'Se juega con ocho mazos de cartas o tarjetas, se presentan dos manos PLAYER y BANKER; el objetivo de los participantes es predecir cuál de las dos manos tendrá una suma de puntos de nueve o más cercana a nueve; Los participantes deberán de realizar sus apuestas antes de que el facilitador cierre las apuestas e inicie con la ronda de repartición; si el participante acierta con base en las instrucciones del juego, le permite la obtención de un premio según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.\r\n**Consulte las reglas para las versiones PANA y DRAGON, QUICK HIT y BACCARAT FORTUNA.\r\n\r\n',	'Aprende a jugar Baccarat',	'Reglas de Baccarat',	1,	0,	'2016-08-30 16:48:42',	'2017-02-02 19:52:10'),
