(11,	2,	NULL,	'Ultimate Texas Hold’em',	'ultimate-texas-holdem',	'Ultimate Texas Hold’em',	'/assets/images/juegos/mxo2y1db6xpgsr457.jpg',	NULL,	'En una versión basada en el  tradicional juego de póker, se juega con un mazo de cartas o tarjetas ; el objetivo de los participantes es hacer la mejor combinación de cinco cartas o tarjetas, utilizando sus dos cartas iniciales más las cartas comunitarias;  el objetivo de los  participante es ganarle al facilitador obteniendo  un rango mayor de combinación de cartas o tarjetas , lo que le permite la obtención de un premio  según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.',	'aprender a jugar text',	'reglas del juego txt',	1,	0,	'2016-12-15 12:43:25',	'2017-02-02 19:50:57'),
(12,	1,	2,	'Powermania 1',	'powermania-1',	'Powermania',	'/assets/images/juegos/fws6mjzerl0libq3m.jpg',	'/assets/images/juegos/zyzcagfjlpsh6eh9w.jpg',	'4 veces más divertido',	'Más premios, más bonus, más diversión.\r\nCuatro formas diferentes para conseguir grandes premios, con el nuevo juego de Zitro podrás disfrutar de nuestro exclusivo juego slot bonus muchas más veces',	'Logra alguno de los 4 premios que te permite alcanzar el juego de slot bonus y\r\ndonde podrás conseguir muchos más premios combinando figuras en los rodillos.\r\nSuperbingo, Thunderball, Rebajas y Jerrypot…\r\nAccede a todo esto con solo pulsar el botón de Super Win.',	1,	0,	'2016-12-15 13:09:40',	'2017-03-08 15:18:23'),
(13,	2,	NULL,	'Pai Gow  Poker',	'pai-gow-poker',	'Pai Gow  Poker',	'/assets/images/juegos/d30tjfbpfknrpl49q.jpg',	NULL,	'En una versión basada en el  tradicional juego de póker, se juega con un mazo de cartas o tarjetas más un joker ; el objetivo de los participantes es hacer la mejor combinación de  dos manos,  la mano baja de dos cartas y la mano alta de cinco  cartas o tarjetas;  el objetivo de los  participante es ganarle al facilitador obteniendo  un rango mayor de combinación de cartas o tarjetas, lo que le permite la obtención de un premio  según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.',	'aprende',	'reglas',	1,	0,	'2017-01-17 17:25:09',	'2017-02-02 19:53:47'),
(14,	2,	NULL,	'Ruleta',	'ruleta',	'Ruleta',	'/assets/images/juegos/nidl5hf4adiyfiy9c.jpg',	NULL,	'Disco giratorio de 38 números, el objetivo del participante  es predeterminar el número, símbolo o color ganador, realizando apuestas antes de que el facilitador haga el lanzamiento y antes de que se cierren las apuestas;   si el participante acierta le permite la obtención de un premio  según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.',	'aprende ',	'reglas',	1,	0,	'2017-01-17 17:25:38',	'2017-02-02 19:55:24'),
(15,	2,	NULL,	'Craps',	'craps',	'Craps',	'/assets/images/juegos/48buu5v1scaqhvm6g.jpg',	NULL,	'Juego de dados, el objetivo del juego es pronosticar el valor de los dos dados que serán lanzados por lanzador en turno antes de que se cierren las apuestas, el participante comparará el resultado de los dados  con las apuestas o combinaciones seleccionadas previamente,  si acierta le permite la obtención de un premio  según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.',	'aprende',	'reglas',	1,	0,	'2017-01-17 17:26:03',	'2017-02-02 20:32:49'),
(16,	2,	NULL,	'Chuck a Luck ',	'chuck-a-luck',	'Chuck a Luck ',	'/assets/images/juegos/5cchl7km1ljduq09u.jpg',	NULL,	'Juego de dados que serán lanzados por el facilitador dentro de una tómbola;  el objetivo del  participante  es pronosticar el valor de los dos dados antes de que se cierren las apuestas, el participante comparará el resultado de los dados  con las apuestas o combinaciones seleccionadas previamente,  si acierta le permite la obtención de un premio  según el monto, la modalidad de la apuesta realizada y de acuerdo a los momios establecidos en la tabla de pagos.',	'aprende',	'reglas',	1,	0,	'2017-01-17 17:26:34',	'2017-02-01 21:39:30'),
(17,	2,	NULL,	'Texas Hold’em',	'texas-holdem',	'Texas Hold’em ',	'/assets/images/juegos/w4bp3jaq138wa1s41.jpg',	NULL,	'Los participantes compiten entre sí por un monto de dinero  en fichas colocado por todos los participantes, “llamado POZO”,  durante el juego  cada  participante intentará tomar   el control del monto del dinero en el pozo, basándose en decisiones que tomará de acuerdo con el valor o combinación de sus cartas o tarjetas; El objetivo de cada participante es hacer la mejor combinación o mano  de cinco cartas o tarjetas, utilizando sus dos cartas más las cinco cartas o tarjetas comunitarias , el participante con el mejor rango o combinación y de acuerdo con las instrucciones del juego le permitirá la obtención del pozo.',	'aprende',	'reglas',	1,	0,	'2017-01-17 17:27:00',	'2017-02-02 20:22:28'),
