(7,	4,	'Gana boletos para partidos de los Xolos',	'boletos-xolos',	'&nbsp;',	'',	'/assets/images/promociones/thumbs/akmfnub0dft0fvpi8.jpg',	'<html>\r\n    <head>\r\n        <link href=\"http://www.grupocaliente.com.mx/ws/csstablas/bootstrap.css\" rel=\"stylesheet\">\r\n    </head>\r\n<body>\r\n\r\n<div class=\"col-md-12\">\r\n        <div align=\"center\"><img class=\"img-responsive\" src=\"http://casinocaliente.abardev.net/assets/images/promociones/2yq199vgh2i23dgcc.jpg\" width=\"100%\"></div><br /><br /><br />\r\n    <div align=\"justify\">\r\n    <p>Regístrate a Caliente Club y apuesta en las carreras de galgos de Caliente Canódromo y participa para ganar boletos para los partidos de local de Xolos en la Liga Bancomer MX. Sólo tienes que presentar tu tarjeta cada vez que realices una apuesta, así acumularás puntos y con tus puntos generarás folios para participar. Obtienes un folio de participación por cada 20 puntos generados por tus apuestas.</p>\r\n\r\n    <p>Se realizarán 8 dinámicas para elegir a los ganadores de los boletos de acuerdo al siguiente \r\n    calendario:</p>\r\n&nbsp;<br />\r\n    <table class=\"table table-bordered table-hover\" style=\"text-align:center\">\r\n      <tr class=\"warning\">\r\n        <td>FECHA</td>\r\n        <td>HORA</td>\r\n        <td>LUGAR</td>\r\n        <td>PERIODO DE ACUMULACIÓN DE FOLIOS</td>\r\n        <td>PREMIO</td>\r\n        <td>JUEGO</td>\r\n      </tr>\r\n    <tr >\r\n        <td>25-ene-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>11 al 24 de Enero de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuana vs Cruz Azul</td>\r\n      </tr>\r\n    <tr  >\r\n        <td>08-feb-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>25 de Enero al 07 de Febrero de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuana vs Necaxa</td>\r\n      </tr>\r\n    <tr >\r\n        <td>22-feb-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>08 al 21 de Febrero de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuana vs Monterrey</td>\r\n      </tr>\r\n    <tr >\r\n        <td>01-mar-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>22 al 28 de Febrero de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuana vs Pachuca</td>\r\n      </tr>\r\n    <tr >\r\n        <td>15-mar-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>01 al 14 de Marzo de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuanas vs Santos</td>\r\n      </tr>\r\n    <tr  >\r\n        <td>05-abr-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>15 de Marzo al 04 de Abril de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuana vs América</td>\r\n      </tr>\r\n    <tr >\r\n        <td>19-abr-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>05 al 17 de Abril de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuana vs Toluca</td>\r\n      </tr>\r\n    <tr  >\r\n        <td>03-may-17</td>\r\n        <td>18:00 Pacífico</td>\r\n        <td>Main Line Tijuana Hipódromo</td>\r\n        <td>19 de Abril al 02 de Mayo de 2017</td>\r\n        <td>50 boletos</td>\r\n        <td>Tijuana vs Veracruz</td>\r\n      </tr>\r\n\r\n    </table>\r\n&nbsp;<br />\r\n&nbsp;<br />\r\n\r\n    <p>Sólo particpan clientes que hayan realizado sus apuestas en las carreras de Caliente Canódromo en los siguientes establecimientos:</p>\r\n\r\n        <div class=\"col-md-6\">\r\n            <table class=\"table table-bordered table-hover\" style=\"text-align:center\">\r\n     <tr>\r\n        <td>Rosarito Quinta Plaza</td>\r\n    </tr>\r\n    <tr>\r\n        <td>Tecate Los Encinos</td>\r\n    </tr>\r\n    <tr