INSERT INTO `text_footer` (`id`, `titulo`, `texto`, `estatus`, `created_at`, `updated_at`) VALUES
(1,	'Caliente',	'<div style=\"text-align: justify; \">Diviértete&nbsp;jugando los mejores y más novedosos títulos de máquinas de&nbsp;juego de bingo y rodillos; contamos con las mejores&nbsp;marcas.&nbsp;</div><div style=\"text-align: justify;\"><b><br></b></div><div style=\"text-align: justify; \">Vive al máximo tu deporte favorito apostando en nuestros Race &amp;&nbsp;Sports Books. Contamos con la oferta de apuestas más completa&nbsp;en los mejores eventos deportivos de México y el mundo, o si lo&nbsp;prefieres, emociónate apostando y disfrutando las carreras de los&nbsp;más importantes hipódromos y galgódromos.</div><div style=\"text-align: justify;\"><b><br></b></div><div style=\"text-align: justify;\">Reta tu suerte en las divertidas Mesas de Juego. Nuestra oferta es&nbsp;100% legal y contamos con una gran variedad de juegos como:&nbsp;Blackjack, Ruleta, Craps, Baccarat, Texas Hold’em y más.</div><div><div style=\"text-align: justify;\"><br></div><span><div style=\"text-align: justify;\"><span style=\"letter-spacing: 0.01em; background-color: rgb(255, 255, 255);\">Pasa un rato agradable&nbsp;en nuestras 2 salas de Bingo Tradicional y siente la emoción de gritar ¡Bingo!</span></div></span></div><div style=\"text-align: justify;\"><b><br></b></div><div style=\"text-align: justify;\"><span>En&nbsp;<b>Caliente Casino®</b>&nbsp;nuestra vocación es el entretenimiento de&nbsp;juegos de azar, por lo que nos dedicamos a concebir, desarrollar y&nbsp;ejecutar experiencias superiores e inigualables para aquellos que&nbsp;son verdaderos apasionados de este tipo de entretenimiento.</span></div>',	1,	'2016-12-07 14:21:30',	'2016-12-07 14:21:35');
